var DEFAULT_OPTIONS = {
  maxRetries: 5,
  baseDelay: 1e3,
  // 1 second
  maxDelay: 3e4,
  // 30 seconds
  backoffFactor: 2,
  jitterFactor: 0.1
};
async function withRetry(operation, options = {}) {
  const config = { ...DEFAULT_OPTIONS, ...options };
  let lastError = null;
  for (let attempt = 0; attempt <= config.maxRetries; attempt++) {
    try {
      return await operation();
    } catch (error) {
      lastError = error;
      if (!isRetryableError(error)) {
        throw error;
      }
      if (attempt === config.maxRetries) {
        break;
      }
      const delay = calculateDelay(attempt, config);
      await sleep2(delay);
    }
  }
  throw lastError || new Error("Retry failed with unknown error");
}
function isRetryableError(error) {
  if (error.retryable === true) {
    return true;
  }
  if (error.retryable === false) {
    return false;
  }
  if (error.statusCode) {
    if (error.statusCode >= 500 && error.statusCode < 600) {
      return true;
    }
    if (error.statusCode === 429) {
      return true;
    }
    if (error.statusCode === 408) {
      return true;
    }
  }
  const message2 = error.message.toLowerCase();
  const retryablePatterns = [
    "timeout",
    "connection",
    "network",
    "throttl",
    "rate limit",
    "overload",
    "busy",
    "unavailable"
  ];
  return retryablePatterns.some((pattern) => message2.includes(pattern));
}
function calculateDelay(attempt, config) {
  const exponentialDelay = config.baseDelay * Math.pow(config.backoffFactor, attempt);
  const jitter = exponentialDelay * config.jitterFactor * Math.random();
  const delayWithJitter = exponentialDelay + jitter;
  return Math.min(delayWithJitter, config.maxDelay);
}
function sleep2(ms) {
  return new Promise((resolve) => setTimeout(resolve, ms));
}
function createRetryableError(message2, statusCode) {
  const error = new Error(message2);
  error.retryable = true;
  error.statusCode = statusCode;
  return error;
}

